CREATE SCHEMA talasova AUTHORIZATION talasova;


CREATE TABLE talasova.department (
	filial_id int8 NULL,
	department_id int8 NULL,
	dep_chif_id int8 NULL
);


CREATE TABLE talasova.product (
	id text NULL,
	"name" text NULL,
	price int8 NULL,
	sdate timestamp(0) NULL,
	edate timestamp(0) NULL,
	is_actual bool NULL
);


CREATE TABLE talasova.sale (
	sale_date timestamp(0) NULL,
	salesman_id int8 NULL,
	item_id text NULL,
	quantity int8 NULL,
	final_price int8 NULL
);


CREATE TABLE talasova.seller (
	id int8 NULL,
	fio text NULL,
	department_id int8 NULL
);


CREATE TABLE talasova.service (
	id text NULL,
	"name" text NULL,
	price int8 NULL,
	sdate timestamp(0) NULL,
	edate timestamp(0) NULL,
	is_actual bool NULL
);










